INSERT INTO `ps_category_lang` (`id_category`, `id_shop`, `id_lang`, `name`, `description`, `link_rewrite`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1, 1, 1, 'Baza', '', 'baza', '', '', ''),
(2, 1, 1, 'Strona główna', '', 'strona-glowna', '', '', ''),
(11, 1, 1, 'Lampy wewnetrzne', '<div>\n<div>\n<div>\n<p>Profesjonalne oświetlenie jest niezwykle istotnym elementem każdego ogrodu. Należy zatroszczyć się o każdy szczegół przy aranżacji przestrzeni wokół domu, aby stworzyć prawdziwy raj na ziemi. Nasze lampy ogrodowe mają postać zwierzątek, kwiatów, grzybków, jak również innych, bardzo interesujących kształtów. Warto stworzyć we własnym ogrodzie coś niesamowitego – wyjątkowe miejsce, które może dać ciszę, spokój oraz radość czerpaną z każdej chwili.</p>\n</div>\n</div>\n</div>\n<p></p>', 'lampy-wewnetrzne', '', '', ''),
(12, 1, 1, 'Lampy zewnetrzne i ogrodowe', '<p>Profesjonalne oświetlenie jest niezwykle istotnym elementem każdego ogrodu. Należy zatroszczyć się o każdy szczegół przy aranżacji przestrzeni wokół domu, aby stworzyć prawdziwy raj na ziemi. Nasze lampy ogrodowe mają postać zwierzątek, kwiatów, grzybków, jak również innych, bardzo interesujących kształtów. Warto stworzyć we własnym ogrodzie coś niesamowitego – wyjątkowe miejsce, które może dać ciszę, spokój oraz radość czerpaną z każdej chwili.</p>', 'lampy-zewnetrzne-i-ogrodowe', '', '', ''),
(13, 1, 1, 'Żyrandole', '<div>\n<div class=\"hide md-show\">\n<div class=\"pagebuilder-column-group\">\n<div class=\"pagebuilder-column-line\">\n<div class=\"pagebuilder-column\">\n<div>\n<p><strong>Żyrandole</strong> mają bardzo szerokie zastosowanie w domach, mieszkaniach, jak również w większych salach i holach. <strong>Żyrandole</strong> świetnie <strong>oświetlają</strong> pomieszczenia. Mogą przybierać różne bardziej lub mniej skomplikowane konstrukcje. Nowoczesne <strong>żyrandole</strong> mogą być wykonane z metalu, szkła, kryształów, plastiku oraz różnych innych materiałów. Obecnie <strong>żyrandole</strong> stanowią nieodzowną część dekoracji wnętrza. Niejednokrotnie dzięki <strong>żyrandolom</strong> pomieszczenia, w których się znajdują, nabierają niepowtarzalnego charakteru i klimat.</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<p></p>', 'zyrandole', '', '', ''),
(14, 1, 1, 'Wieszące', '<p>Nasz sklep oferuje różnego rodzaju lampy wiszące do sypialni, salonu, kuchni i pokoju. Proponowane przez nas artykuły nie tylko rozświetlą każde wnętrze, ale również nadadzą mu niepowtarzalnego charakteru. Dokładamy wszelkich starań, aby nasze oświetlenie wiszące odpowiadało gustom nawet najbardziej wymagających klientów. Proponowane przez nas produkty ozdobią nowoczesne wnętrze pokoju, a także podkreślą urok antyków ze stylowego salonu. W naszym sklepie, proponujemy tanie rozwiązania, ale i nieco droższe, ekskluzywne oprawy oświetleniowe, takie jak lampy firmy Swarovski. Oferujemy nowoczesne rozwiązania, wykonane z drewna, plecione, metalowe, kryształowe w wielu atrakcyjnych rozmiarach, kolorach i kształtach.</p>', 'wieszace', '', '', ''),
(15, 1, 1, 'Biurkowe', '<p>Wybierając oświetlenie wiele osób zwraca uwagę na klasyczne rozwiązania, styl, jakość i tradycję. W naszej kolekcji oferujemy klasyczne lampy, zarówno kinkiety, plafony i żyrandole, jak również i jedyne w swoim rodzaju lampy stojące, biurkowe i świeczniki. Pozłacane, z ciekawymi ornamentami, niezwykle pięknie zdobione. Coraz częściej tworząc umeblowanie do domu, nawiązujemy do tradycji i staromodnych rozwiązań. Klasyczne lampy z palety naszych produktów, na pewno sprawdzą się idealnie. Wypełnią każde mieszkanie, każdy dom i każde pomieszczenie, w którym podstawę stanowi najwyższa jakość produktów.</p>', 'biurkowe', '', '', ''),
(16, 1, 1, 'Dekoracyjne', '<p>Zewnętrzne elementy dekoracyjne stanowią idealne dopełnienie do Twojego ogrodu. Spacerując po posesji oświetlonej naszymi lampami na pewno nie będziesz chciał wracać zbyt szybko do domu. Oferujemy szeroki wybór figurek dekoracyjnych, lamp, lampionów, łańcuchów, girland. Wszystkie nadadzą blasku i uroku Twojemu ogrodowi.</p>', 'dekoracyjne', '', '', ''),
(17, 1, 1, 'Solarne', '<p>Efektywne? Z całą pewnością! Funkcjonalne? Bez dwóch zdań! Oryginalne? Na pewno! Takie właśnie są lampy solarne, do zastosowania, jako oświetlenie ogrodowe. W palecie naszych produktów znajdują się różnorodne wzory i modele. Wszystko dla Państwa potrzeb, wymagań i oczekiwań. Jeśli jakość za dobrą cenę i produkt cieszący oko i spełniający się w praktyce, to tylko, jako oświetlenie solarne, w pełni dostępne w naszym sklepie online.</p>', 'solarne', '', '', ''),
(18, 1, 1, 'Sufitowe', '<p>Jeśli dobre oświetlenie ogrodowe, to plafony okażą się być do tego opcją trafioną w dziesiątkę. Polecamy Państwu serdecznie takie właśnie oświetlenie w przydomowej altance lub tuż przy wyjściu do bajecznego raju. Pięknie, niedrogo i efektywnie, a więc tak, jak nam się marzy. Duży wybór plafonów w naszej ofercie, to możliwość wyboru tego, co tylko Państwu pasuje i co Wam odpowiada.</p>', 'sufitowe', '', '', '');
