(1, 1, 1, 'Dostawa', '', 'nasze zasady i warunki dostawy', 'conditions, delivery, delay, shipment, pack', '<h2>Wysyłki i zwroty</h2>\n<p><strong>Twoja paczka</strong><br /><br />Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i są wysyłane za pośrednictwem firmy UPS ze śledzeniem i nadawaniem bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Bez względu na to, jakiego rodzaju przesyłki wybierzesz, otrzymasz od nas link do śledzenia przesyłki online.<br /><br />Opłaty za wysyłkę obejmują opłaty manipulacyjne i koszty pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Zalecamy zgrupowanie artykułów w jednym zamówieniu. Nie możemy zgrupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą naliczane dla każdego z nich. Paczka zostanie wysłana na własne ryzyko, ale należy zachować szczególną ostrożność w celu ochrony delikatnych przedmiotów.<br /><br />Pudełka są pokaźnych rozmiarów, a Twoje przedmioty są dobrze chronione.</p>', 'dostawa'),
(2, 1, 1, 'Nota prawna', '', 'Nota prawna', 'notice, legal, credits', '<p><strong>Prawny</strong></p>\n<p>Kredyty<br /><br />Koncepcja i produkcja:<br /><br />Ta witryna internetowa została utworzona przy użyciu oprogramowania typu open source PrestaShop™.</p>', 'nota-prawna'),
(3, 1, 1, 'Regulamin użytkowania', '', 'Nasze warunki użytkowania', 'conditions, terms, use, sell', '<h2>Twoje warunki użytkowania</h2>\n<p></p>', 'regulamin-uzytkowania'),
(4, 1, 1, 'O nas', '', 'Dowiedz się więcej o nas', 'about us, informations', '<p>O nas<br />Nasza firma<br /><br />Nasza firma<br />Nasz zespół<br /><br />Nasz zespół<br />Informacje<br /><br />Informacje</p>', 'o-nas'),
(5, 1, 1, 'Bezpieczna płatność', '', 'Nasz bezpieczny sposób płatności', 'secure payment, ssl, visa, mastercard, paypal', '<p>Bezpieczna płatność<br />Nasza bezpieczna płatność<br /><br />Z SSL<br />Korzystanie z karty Visa/Mastercard/Paypal<br /><br />O tych usługach</p>', 'bezpieczna-platnosc');
